import React from 'react'

const Intro = () => {
  return (
    <div className="bg">
      <button style={styles.emp}>I'm Looking for a Job</button>
      <button>I'm Looking to Hire</button>
    </div>
  )
}
const styles={
  emp:{
    height: "50px"
    
  }

}
export default Intro
